import requests
import json
import urllib3
from urllib.parse import urlparse

def send_post_requests(requests_data):
    # Disable SSL warnings
    urllib3.disable_warnings(urllib3.exceptions.InsecureRequestWarning)

    # Initialize an empty list to store the status codes
    error_status_codes = []

    # Iterate over the URLs and data
    for rd in requests_data:
        # Convert the data to JSON format
        json_data = json.dumps(rd["data"])

        # Send the POST request and get the response
        response = requests.post(rd["url"], data=json_data, verify=False)

        # If the status code is not 200, add it to the list
        if response.status_code != 200:
            # Parse the URL to get the port and the path
            parsed_url = urlparse(rd["url"])
            port_path = f"{parsed_url.port}{parsed_url.path}"

            error_status_codes.append({
                "port_path": port_path,
                "status_code": response.status_code
            })

    # Return the list of status codes
    return error_status_codes

